		YY_FATAL_ERROR( "out of dynamic memory in MIME_parse__scan_bytes()" );

	for ( i = 0; i < _yybytes_len; ++i )
		buf[i] = yybytes[i];

	buf[_yybytes_len] = buf[_yybytes_len+1] = YY_END_OF_BUFFER_CHAR;

	b = MIME_parse__scan_buffer(buf,n );
